import React from 'react';
import logo from '../logo.svg';

function Body(props) {

    var user = props.userDetails;
    return(
        <div>
            <img src={logo} className="App-logo" alt="logo" /> <br/>
            <ul>
                <li> <b> First Name: </b> {props.data.firstName}  </li>
                <li> <b> Last Name: </b> {user.lastName}  </li>
                <li> <b> Location: </b> {user.location}  </li>
            </ul>
            <button className="btn btn-primary">On</button>
        </div>
    );
}

export default Body;
